pragma solidity ^0.5.0;
contract Challan {
    uint public chalanCount = 0;
    mapping(uint => Chalan) all_challans;
    
    constructor () public {
    }

    struct Chalan {
      uint challan_number_in_day;
      string vehicle_number_plate;
      string date_time;
      
      uint violation_type;
      uint fine_amount;
      
      string driver_name;
      string driver_cnic;
      string owner_cnic;
      uint warden_id;
      
      string due_date;
      uint paid_information;
      
      string confiscated_document;
      uint available_at;
  
      uint latitude_number_part;
      uint latitude_decimal_part;
      uint longitude_number_part;
      uint longitude_decimal_part;
      string filename;
    }

    function add_Chalan(uint c_no,string memory _vnp,string memory _d,uint _vt,uint _fa,string memory _dn,string memory _dc,string memory _oc,uint _wi,string memory _dd,string memory _cd,uint _aa) public returns  (uint){
        uint _pi=0;
        all_challans[chalanCount] = Chalan(c_no,_vnp,_d,_vt,_fa,_dn,_dc,_oc,_wi,_dd,_pi,_cd,_aa,0,0,0,0,"");
        chalanCount++;
        return chalanCount;
        //}else if(_d!=all_challans[chalanCount].date){
            
          //  all_challans[chalanCount] = Chalan(all_challans[chalanCount-1].challan_number_in_day+1,_vnp,_d, //_t, _vt,_fa,_dn,_dc,_oc,_wi,_dd,_pi,_cd,_aa,0,0,0,0,"");
          //  chalanCount++;
           // return chalanCount;
        //}
    }
    
    function add_Cordinates(uint _lan,uint _lad,uint _lon,uint _lod,string memory _f)public returns (uint){
        all_challans[chalanCount].latitude_number_part=_lan;
        all_challans[chalanCount].latitude_decimal_part=_lad;
        all_challans[chalanCount].longitude_number_part=_lon;
        all_challans[chalanCount].longitude_number_part=_lod;
        all_challans[chalanCount].filename=_f;
        return 1;
    }

    function getChallan1(uint index) public view returns(uint,string memory,string memory,uint,uint,string memory,string memory) {
        return (all_challans[index].challan_number_in_day,all_challans[index].vehicle_number_plate,all_challans[index].date_time,all_challans[index].violation_type,all_challans[index].fine_amount,all_challans[index].driver_name,all_challans[index].driver_cnic);
    }
    function getChallan2(uint index) public view returns(string memory,uint,string memory,uint,string memory,uint) {
        return (all_challans[index].owner_cnic,all_challans[index].warden_id,all_challans[index].due_date,all_challans[index].paid_information,all_challans[index].confiscated_document,all_challans[index].available_at);
    }
    function getChallan3(uint index) public view returns(uint,uint,uint,uint,string memory) {
        return (all_challans[index].latitude_number_part,all_challans[index].latitude_decimal_part,all_challans[index].longitude_number_part,all_challans[index].longitude_decimal_part,all_challans[index].filename);
    }

    function add_paid_information(uint _cn,uint _is) public {
        require(_cn<=chalanCount);
        require(_cn>0);
        all_challans[_cn].paid_information=_is;
        
        
    }
    function compareStrings (string memory a, string memory b) public view 
       returns (bool) {
    return (keccak256(abi.encodePacked((a))) == keccak256(abi.encodePacked((b))) );

     }
    
    enum violation_types { TL, OS, NH, NNP, BW, NSB }
    // TL = Traffic Light
    // OS = OverSpeeding
    // NH = No Helmet 
    // NNP = No Number Plate
    // BW = Black Windows
    // NSB = No Seat Belt
    
    function strConcat(string memory _a, string memory _b) internal returns (string memory){
        bytes memory _ba = bytes(_a);
        bytes memory _bb = bytes(_b);
        bytes memory _bcomma = bytes(":");
        string memory abcd = new string(_ba.length + _bb.length+1);
        bytes memory babcde = bytes(abcd);
        uint k = 0;
        for (uint i = 0; i < _ba.length; i++) babcde[k++] = _ba[i];
        babcde[_ba.length]=_bcomma[0];
        for (uint i = 0; i < _bb.length; i++) babcde[k++] = _bb[i];
        
        return string(babcde);
    }
    function uint2str(uint _i) internal pure returns (string memory _uintAsString) {
        if (_i == 0) {
            return "0";
        }
        uint j = _i;
        uint len;
        while (j != 0) {
            len++;
            j /= 10;
        }
        bytes memory bstr = new bytes(len);
        uint k = len - 1;
        while (_i != 0) {
            bstr[k--] = byte(uint8(48 + _i % 10));
            _i /= 10;
        }
        return string(bstr);
    }
    
  
}
